import React, {useEffect} from 'react';
import Stack from "@mui/material/Stack";
import { AircraftItem } from './AircraftItem';
import { Paper } from '@mui/material';
import useRotationStack from '../../../store/useRotationStack';

const Aircrafts: React.FC = () => {
    const { flightsRotation } = useRotationStack((state) => ({
      flightsRotation: state.flightsRotation,
    }));

    return (
      <Paper sx={{ height: "90vh", width: "56vh" }}>
        <Stack
          direction="column"
          justifyContent="space-evenly"
          alignItems="center"
          spacing={2}
        >
          {flightsRotation.map((aircraft: any) => (
            <AircraftItem aircraft={aircraft} key={`aircraftItem-${aircraft.id}`} />
          ))}
        </Stack>
      </Paper>
    );
};

export default Aircrafts;
